@stereotype(CIMStereotype.enumeration)
@stereotype(CIMStereotype.Attribute)
class XSDDatatypeKind(Enum):
    '''
    The XSD datatypes kinds.
    '''

    anyURI = 'anyURI'
    '''
    The anyURI represents a Uniform Resource Identifier Reference (URI).
    An anyURI value can be absolute or relative, and may have an optional
    fragment identifier (i.e., it may be a URI Reference). This type should
    be used to specify the intention that the value fulfils the role of
    a URI as defined by [RFC 2396], as amended by [RFC 2732].
    '''
    
    boolean = 'boolean'
    '''
    Boolean has the &#183;value space&#183; required to support the mathematical
    concept of binary-valued logic: {true, false}.
    '''
    
    date = 'date'
    '''
    The &#183;value space&#183; of date consists of top-open intervals
    of exactly one day in length on the timelines of dateTime, beginning
    on the beginning moment of each day (in each timezone), i.e. '00:00:00',
    up to but not including '24:00:00' (which is identical with '00:00:00'
    of the next day). For nontimezoned values, the top-open intervals disjointly
    cover the nontimezoned timeline, one per day. For timezoned values,
    the intervals begin at every minute and therefore overlap.
    '''
    
    dateTime = 'dateTime'
    '''
    The dateTime values may be viewed as objects with integer-valued year,
    month, day, hour and minute properties, a decimal-valued second property,
    and a boolean timezoned property.
    '''
    
    decimal = 'decimal'
    '''
    Decimal represents a subset of the real numbers, which can be represented
    by decimal numerals.
    '''
    
    double = 'double'
    '''
    The double datatype is patterned after the IEEE double-precision 64-bit
    floating point type [IEEE 754-1985].
    '''
    
    duration = 'duration'
    '''
    Duration represents a duration of time. The &#183;value space&#183;
    of duration is a six-dimensional space where the coordinates designate
    the Gregorian year, month, day, hour, minute, and second components
    defined in &#167; 5.5.3.2 of [ISO 8601], respectively. These components
    are ordered in their significance by their order of appearance i.e.
    as year, month, day, hour, minute, and second.
    '''
    
    float = 'float'
    '''
    Float is patterned after the IEEE single-precision 32-bit floating
    point type [IEEE 754-1985].
    '''
    
    integer = 'integer'
    '''
    Integer is derived from decimal by fixing the value of fraction digits
    to be 0 and disallowing the trailing decimal point. This results in
    the standard mathematical concept of the integer numbers. The value
    space of integer is the infinite set {...,-2,-1,0,1,2,...}, [W3C Recommendation,
    XML Schema Definition Language (XSD) 1.1 Part 2: Datatypes, 5 April
    2012].
    '''
    
    string = 'string'
    '''
    The string datatype represents character strings.
    '''
    
    time = 'time'
    '''
    Time represents an instant of time that recurs every day.
    '''
    
    @property
    def __namespace__(self):
        return 'http://cim.ucaiug.io/CIM101/draft#'
    @property
    def __package__(self):
        return 'DetailedModelDescription'
    @property
    def __minOccurs__(self):
        return '0'
    @property
    def __maxOccurs__(self):
        return 'unbounded'
    
